import React from 'react';
import s from './Dialogs.module.css'
import {NavLink} from "react-router-dom";
import {DialogItem} from "./DialogItem/DialogItem";
import {Message} from "./Message/Message";

type DialogsType = {
    id: number
    name: string
}

type MessageType = {
    message: string
}


export const Dialogs = (props: DialogsType) => {
    let dialogsData = [
        {id: 1, name: 'Eduarda'},
        {id: 2, name: 'Artiom'},
        {id: 3, name: 'Dasha'},
        {id: 4, name: 'Ivan'},
        {id: 5, name: 'Ekaterina'},
    ]

    let messageData = [
        {id: 1, message: 'Hi!'},
        {id: 2, message: 'How is your day?'},
        {id: 3, message: 'It\'s good, thanks!'},
    ]
    const dialog = dialogsData.map((ev)=>{
        return (
            <DialogItem id={ev.id} name={ev.name}/>
        )
    })
    const message = messageData.map((ev)=>{
        return (
            <Message message={ev.message}/>
        )
    })

    return (

        <div className={s.dialogs}>
            <div className={s.dialogItem}>
           {/*     <Dialog id={0} name={'Eduarda'}/>
                <Dialog id={1} name={'Artiom'}/>
                <Dialog id={2} name={'Dasha'}/>
                <Dialog id={3} name={'Ivan'}/>
                <Dialog id={4} name={'Ekaterina'}/>*/}
                {dialog}
            </div>
            <div className={s.messages}>
                {message}
            </div>
        </div>
    );
};
